<script>
  export default {
    name: "NextenIllu",
    data(){
      return {
        bigcarCoords: {
          x: 481.953470, y: 221.009299,
        },
        smallCar1Coords: {
          x: 735.961145, y: -0.00000
        },
        smallCar2Coords: {
          x: 0.000000, y: 195.956698
        },
      }
    },
    mounted() {
      const bigCar = document.getElementById("nexten-flying-car");
      const smallCar1 = document.getElementById("2-nexten-small-flying-car-1");
      const smallCar2 = document.getElementById("3-nexten-small-flying-car-2");

      function moveItemParallax(state, event, item, oX, oY, factor){
        const mouseX = event.clientX;
        const mouseY = event.clientY;

        const pageYcenter = window.innerHeight /2
        const pageXcenter = window.innerWidth /2

        const posX = mouseX - pageXcenter
        const posY = mouseY - pageYcenter
        const itemHeight = item.clientHeight;
        item.style.transform = `translate(${(oX) - (posX) / factor}px, ${((oY + itemHeight) - (posY) / factor)}px)`;
      }
        // const winHeight = window.innerHeight;
      // const winWidth = window.innerWidth;
      document.addEventListener('mousemove', (e) => {
        moveItemParallax(this.bigcarCoords, e, bigCar, this.bigcarCoords.x, this.bigcarCoords.y, 30);
        moveItemParallax(this.smallCar1Coords, e, smallCar1, this.this.smallCar1Coords.x, this.smallCar1Coords.y, 80);
        moveItemParallax(this.smallCar2Coords, e, smallCar2, this.smallCar2Coords.x, this.smallCar2Coords, 120);
      });
      document.addEventListener('scroll', () => {
        bigCar.style.transform = `translate(${this.bigcarCoords.x}px, ${((this.bigcarCoords.y) + window.scrollY / 10)}px)`;
        smallCar1.style.transform = `translate(${this.this.smallCar1Coords.x}px, ${((this.smallCar1Coords.y) + window.scrollY / 13)}px)`;
        smallCar2.style.transform = `translate(${this.smallCar2Coords.x}px, ${((this.smallCar2Coords) + window.scrollY / 15)}px)`;
        // moveItemParallax(e, bigCar, this.bigcarCoords.x, this.bigcarCoords.y, 5);
        // moveItemParallax(e, smallCar1, this.smallCar2Coords.x, -0.00000, 5);
        // moveItemParallax(e, smallCar2, 0.000000, 195.956698, 5);
      });
    },
  }
</script>

